import React, { Component } from "react";
import HeaderNav from "../components/HeaderNav";
import PageTitle from "../components/PageTitle";
import Project from "../components/Project";
class Projects extends Component {
  state = {
    profileDisplay: false
  };

  render() {
    const projects = [
      {
        name: "Quote",
        description:
          "Quote is a full stack project I've been working on for just a few weeks now. The idea is to be a dedicated and intimate platform for sharing moments through quotes. Friends can post things said by their friends either publicly or in groups, and have them approved or denied. Approved quotes land on the speaker's own quote page. Node.js and Express.js are used to set up the server and routing, while Sequelize.js is used with MySQL to store user information. User authentication is done through Google Firebase, which also provides the uuid for accessing database information. Finally, Handlebars is used to render the HTML. This project is a work in progress and changes every day. I will attempt to keep this page as updated as I can and will post the link when I first push it to heroku!"
      }
    ];
    return (
      <div>
        <HeaderNav selected={"Projects"} />
        <section className={`page projects-page flex-row`}>
          <div className="flex-column page-main">
            <PageTitle pageName="Projects" />
            <div>
              <p>
                Over the past six months, I have worked tirelessly to not only
                learn, but to also create. I have put a great deal of effort
                into homework assignments, group projects, and, more recently,
                personal projects. This will be a relatively in-depth look at
                some of my favorite creations.
              </p>
            </div>
          </div>

        </section>
      </div>
    );
  }
}
export default Projects;
